        Accept: "application/json",
        "Content-Type": "application/json"
      },
      credentials: "include"

    });

    console.log(res);

    const data = await res.json();
    console.log(data);




    // console.log(data);
    // setUserData(res);

    if (!data.status === 200) {
      const error = new Error(data.error);
      throw error;
    }

  }
  catch (err) {
    // console.log(err);
    navigate("/Login");
  }
}

useEffect(() => {
  callAboutPage();

}, []);
